(320, 'IDEA3bc73bedad2ffcec', 'HOD-248db3394eaeb58d', '', 'MURA,MURI', '', 'TEPL-IE-C-FR-0005', '01/06.07.2023', 'OOC', 'IM/PP/05', 'D,S', 'IM 01 Process', 'Poka yoke in Rail placing', '', 'Provide stopper pin in Heating Fixture', 'Main Plant', 'There is no POKA YOKE for Rail placing in Heating Fixture, due to this rail can place wrong direction and it possible for Mold damage and it affect part qualitity.', 'Locating guide pin placed in fixture 3 places to avoid rail placing wrong orientation', 'Ipsum', 'IMD', '', '99999', '', 'Ipsum', 'Ipsum', 'Ipsum', 'Ipsum', 'prasad.parkhi@tataelectronics.co.in', 'tajender.khurana@tataelectronics.co.in', '', '', '', '168861370500jpeg.jpeg', 'jpeg', '1688614168000jpeg.jpeg', 'jpeg', 'Pareto Chart,Fishbone Diag,FMEA', '', '', '', 'Why 1\r\nTo eliminate mold damages and mold repair down time\r\n\r\nWhy 2\r\nWrong insert orientation will cause mold damage\r\n\r\nWhy 3\r\nNo poka yoke/provision to prevent wrong orientation in heating fixture', '\"There is no poka-yoke/ provision  avaiable in  Preheating Fixture.\r\nSo, even if the rail orientation is changed during the placement by operator, it can\'t be easily noticed and potentially the rails would be placed in a mold with wrong orientation whci shall cause mold damage as well as defect part.\"', '\"This Poka Yoke improvement (stopper pin) is used to improve the rail locating guidance to avoid wrong direction placing.                                                                              Locator pin has been placed in fixture for bottom rail, left rail & right rail toavoid direction wrong loading and Mold damage as well as correction time saved.                                                                      After implementing a poka yoke, operator can\'t able to place a rail in wrong orientation. This problem will be permanently eliminated.\r\n\r\nPOKA YOKE Pin made in Inhouse with tool room mfg support.', 'Q - This poka yoke will make sure the rail orientation is always right.              S -  This will ensure and prevent mold or part damage and improves mold\r\n       safety.                                                                                                                           M- It will increase MTTR & MTBF (as of now no data).                                                Since IM1 is citical for further downstream process, this will have direct impact of unplanned downtime (reduction) in downstream process till final assembly.', 'NO', '', '', '', '', 'Production', 'Production - Anodizing', 'Rajaram', '2023-07-06', '06', '07', '2023', 'Production - Anodizing', '206361 - Arunabha Nath', '206361', 'arunabha.nath@tataelectronics.co.in', '2023-07-06', '', '', '', '6', '0', '2', 'USER-3d2969f7d04ae785', '', '-', '', '', '06', '07', '2023', 'July 6, 2023, 9:21 am', '1688581800', '', '206361', 'Approved', 'July 6, 2023, 9:56 am', '203011', '2', '-', 'July 6, 2023, 10:34 am', '202445', '2', '-', 'July 6, 2023, 10:13 am', '1', '2', ''),
